import axios from "axios"; 
import React from "react"; 
import { useEffect, useState } from "react"; 
import '../scss/product.scss'

function Product() { 
	const [productList, setProductList] = useState([]); 
	// Fetch tasks from database 
	useEffect(() => { 
		axios.get('http://localhost:3001/getProductList') 
			.then(result => { 
				setProductList(result.data) 
			}) 
			.catch(err => console.log(err)) 
	}, []) 

	return ( 
		<div className="product-tiles container mt-5"> 
			<div className="row"> 
					{Array.isArray(productList) ? ( 
						<ul className="col-md-12"> 
							{productList.map((data) => ( 
							<li key={data._id} class="col-md-4">
								  <div class="col-md-6 col-lg-4">
									  <div class="card text-black">
										<img src="https://mdbcdn.b-cdn.net/img/Photos/new-templates/bootstrap-product-cards/img1.webp"
										  class="card-img-top" alt="iPhone" />
										<div class="card-body">
											<div class="text-center mt-1">
												<h4 class="card-title">{data.productName}</h4>
												<h6 class="text-primary mb-1 pb-3">{data.productPrice}</h6>
											</div>
											<div class="d-flex flex-row">
												<button  type="button" data-mdb-button-init data-mdb-ripple-init class="btn btn-primary flex-fill me-1" data-mdb-ripple-color="dark">
													Learn more
												</button>
												<button  type="button" data-mdb-button-init data-mdb-ripple-init class="btn btn-danger flex-fill ms-1">Buy now</button>
											</div>
										</div>
									  </div>
								  </div>
							  </li>
								// <li key={data._id}> 

								// 	{data.productName}
								// 	{data.productPrice} 
								// </li> 
							))} 
						</ul> 
					) : ( 
						<span>Loading products...</span> 
					)} 
			</div> 
		</div> 
	) 
} 
export default Product;
